import ReactDOM from "react-dom/client";

const ToDoList = (state)=>
{
const{items} = state;
        
           
              

               
              
     
  const man = items.map(item=>{
return (
  <div key={item.id}>
     {item.name}

  </div>
)
  } )
        
return (

  <div>{man}</div>
)
   
}

      export default ToDoList;
